import React from 'react';
import { Container, Nav, Navbar } from 'react-bootstrap';
import "../../styles/HeaderStyle.css";

function Header() {
    return (
        <>
            <Navbar
            collapseOnSelect
            expand="lg"
            /*className={`${nav === true ? "sticky" : ""}`} // Clase condicional para navbar fijo*/
            >
            <Container>
                <Navbar.Brand href="#home">

                </Navbar.Brand>
                
                {/* Botón toggle para dispositivos móviles */}
                <Navbar.Toggle aria-controls="responsive-navbar-nav" />
                
                {/* Contenido colapsable */}
                <Navbar.Collapse id="responsive-navbar-nav">
                <Nav className="ms-auto"> {/* Alineado a la derecha */}
                    {/* Enlaces con React Router para SPA */}
                    <Nav.Link as={Link} to="/">Home</Nav.Link>
                    <Nav.Link as={Link} to="/about">About</Nav.Link>
                    <Nav.Link as={Link} to="/menu">Our Menu</Nav.Link>
                    <Nav.Link as={Link} to="/shop">Shop</Nav.Link>
                    <Nav.Link as={Link} to="/blog">Blog</Nav.Link>
                    <Nav.Link as={Link} to="/contact">Contact</Nav.Link>
                    
                    {/* Ícono de carrito con indicador */}
                    <Nav.Link as={Link} to="/">
                    <div className="cart">
                        <i className="bi bi-bag fs-5"></i>
                        <em className="roundpoint">2</em>
                    </div>
                    </Nav.Link>
                </Nav>
                </Navbar.Collapse>
            </Container>
            </Navbar>
        </>
    )
}

export default Header
